import React, { useState, useEffect } from 'react';
import { useParams } from 'react-router-dom';
import {
  Container,
  Paper,
  Typography,
  Grid,
  Card,
  CardContent,
  Button,
  Box,
} from '@mui/material';
import axios from 'axios';

function StudentCard() {
  const { id } = useParams();
  const [student, setStudent] = useState(null);

  useEffect(() => {
    fetchStudent();
  }, [id]);

  const fetchStudent = async () => {
    try {
      const response = await axios.get(`http://localhost:5001/api/students/${id}`, {
        headers: { Authorization: `Bearer ${localStorage.getItem('token')}` },
      });
      setStudent(response.data);
    } catch (error) {
      console.error('Errore nel caricamento dello studente:', error);
    }
  };

  const handleLessonClick = async (lessonIndex) => {
    try {
      await axios.patch(
        `http://localhost:5001/api/students/${id}/lessons/${lessonIndex}`,
        {},
        {
          headers: { Authorization: `Bearer ${localStorage.getItem('token')}` },
        }
      );
      fetchStudent();
    } catch (error) {
      console.error('Errore nell\'aggiornamento della lezione:', error);
    }
  };

  if (!student) {
    return (
      <Container>
        <Typography>Caricamento...</Typography>
      </Container>
    );
  }

  return (
    <Container maxWidth="sm" sx={{ mt: 4 }}>
      <Paper
        elevation={6}
        sx={{
          p: 3,
          border: '4px solid #1976d2',
          borderRadius: 4,
          position: 'relative',
          background: 'rgba(255,255,255,0.95)',
          overflow: 'hidden',
          minHeight: 500,
        }}
      >
        {/* Sfondo boxe */}
        <img
          src="/main.jpg"
          alt="Boxe BG"
          style={{
            position: 'absolute',
            top: 0,
            left: 0,
            width: '100%',
            height: '100%',
            objectFit: 'cover',
            zIndex: 0,
          }}
        />
        <Typography
          variant="h4"
          align="center"
          gutterBottom
          sx={{
            fontFamily: "'Oswald', Impact, Arial, sans-serif",
            fontWeight: 700,
            letterSpacing: 2,
            color: '#222',
            zIndex: 1,
            position: 'relative',
            textShadow: '1px 1px 2px #fff, 0 0 10px #1976d2',
          }}
        >
          {student.name}
        </Typography>
        <Typography
          variant="subtitle1"
          align="center"
          color="textSecondary"
          gutterBottom
          sx={{ zIndex: 1, position: 'relative' }}
        >
          {student.email}
        </Typography>
        <Grid container spacing={2} sx={{ mt: 2, zIndex: 1, position: 'relative' }}>
          {student.lessons.map((lesson, index) => (
            <Grid item xs={12} sm={6} md={4} key={index}>
              <Card
                sx={{
                  bgcolor: lesson.isUsed ? '#e0e0e0' : 'white',
                  cursor: lesson.isUsed ? 'default' : 'pointer',
                  border: lesson.isUsed ? '2px solid #aaa' : '2px solid #1976d2',
                  boxShadow: lesson.isUsed ? 'none' : '0 2px 8px #1976d233',
                  opacity: 0.7,
                }}
                onClick={() => !lesson.isUsed && handleLessonClick(index)}
              >
                <CardContent>
                  <Typography variant="h6" align="center">
                    Lezione {index + 1}
                  </Typography>
                  {lesson.isUsed ? (
                    <Typography variant="body2" align="center" color="textSecondary">
                      {new Date(lesson.date).toLocaleDateString()}
                    </Typography>
                  ) : (
                    <Typography variant="body2" align="center" color="primary">
                      Disponibile
                    </Typography>
                  )}
                </CardContent>
              </Card>
            </Grid>
          ))}
        </Grid>
        <Box sx={{ mt: 3, display: 'flex', justifyContent: 'center', zIndex: 1, position: 'relative' }}>
          <Button
            variant="outlined"
            onClick={() => window.history.back()}
          >
            Torna alla Lista
          </Button>
        </Box>
      </Paper>
    </Container>
  );
}

export default StudentCard;
